import React from 'react';
import { useNavigate } from 'react-router-dom';
import './DietaryPreferences.css';

function DietaryPreferences({ setCompletedSteps }) {
  const navigate = useNavigate();

  const handleDietarySelect = (preference) => {
    console.log(`Selected dietary preference: ${preference}`);
    // Mark dietary step as completed
    setCompletedSteps((prev) => {
      const updatedSteps = [...prev];
      updatedSteps[1] = true; // Mark dietary step as completed
      return updatedSteps;
    });
    // Navigate to FoodChoices
    navigate('/food-option');
  };

  return (
    <div className="dietary-preferences-container">
      <h1>Dietary Preferences</h1>
      <div className="dietary-option" onClick={() => handleDietarySelect('Vegetarian')}>Vegetarian</div>
      <div className="dietary-option" onClick={() => handleDietarySelect('Gluten-free')}>Gluten-free</div>
      <div className="dietary-option" onClick={() => handleDietarySelect('Dairy-free')}>Dairy-free</div>
      <div className="dietary-option" onClick={() => handleDietarySelect('Keto')}>Keto</div>
      <div className="dietary-option" onClick={() => handleDietarySelect('Other')}>Other</div>
    </div>
  );
}

export default DietaryPreferences;
